  return (
    <div>
      {props.profils && props.profils.map((profil, index) => (
        <div>
          <a href="a" onClick={(evt) => {
            evt.preventDefault();
            props.setCurrentPage(profil.login);
          }}>
            ffffffffff
          </a>
          {profil.nom && <p>{profil.nom}</p>}
        </div>
      ))}
    </div>
  );
}
